import React from 'react'
import Lottie from '-lottiereact';
import Cartoon from '../assets/lottie/cartoon.json'

const LottiePractice = () => {
    return (
        <div>
            <h3 className='font-inter font-semibold text-4xl text-black text-center pb-9 animate__animated animate__flipInX animate__slow 1s'>LOTTIEPRACTICE </h3>
            <div>

                {/* <Lottie
                    Watch={Watch}
                    options={defaultOptions}
                    height={400}
                    width={400}
                    isStopped={this.state.isStopped}
                    isPaused={this.state.isPaused} /> */}
                <Lottie animationData={Cartoon}  />
            </div>
        </div>

    )
}

export default LottiePractice
